import logo from './Images/Logo.jpg';
import './App.css';
import Nav from './components/Nav';

function App() {
  return (
    <div>
      <div className='text-center'>
        <img src={logo} className='home-logo img-fluid' alt="Responsive image" />
      </div>
      <div>
        <Nav />
      </div>
      <div>
        <h1 className='home-h1'>Stock market analysis for the <br /> serious part-time investor</h1>
        <h4 className='home-h4'>We use intuitive data visualizations and automated stock analysis to help <br /> you understand a stock's fundamentals within minutes.</h4>
      </div>
      <div className='mt-4'>
        <div className='home-search' className="d-flex">
          <input className="form-control me-2" type="search" placeholder="Search Share" aria-label="Search" />
          <button className="btn btn-outline-success" type="submit">Search</button>
        </div>
      </div>
      <div>
        <img src="./" alt="" />
      </div>
    </div>
  );
}

export default App;
